","/* Global CSS */
@import "mixins";
@import "vars";

* {
  box-sizing: border-box;
}

html {
  font-size: 1px;
}

body {
  margin: 0;
  background-color: $main_background;
  position: relative;
  padding: 0;
  overflow-x: hidden;
}

a {
  text-decoration: none;
}

button {
  cursor: pointer;
}

input,
button {
  outline: none !important;
}

.icon-clock::before {
  content: "\e94e";
}

.icon-eye::before {
  content: "\e9ce";
}

.container {
  width: 100%;
  position: relative;
  max-width: 1440rem;
  margin: 0 auto;
}

main {
  overflow: hidden;
}

.bgc_text {
  position: absolute;
  font-size: 80rem;
  font-family: 'GTWalsheimPro-Regular', sans-serif;
  color: $bgc_text;
  letter-spacing: 0.05em;
  text-transform: uppercase;
}

.section_title {
  font-family: 'GTWalsheimPro-Medium', sans-serif;
  font-size: 60rem;
  margin-top: 50rem;
  font-weight: 500;
  margin-left: 60rem;
  margin-bottom: 0;
  padding-bottom: 17rem;
  position: relative;

  &.blue {
    color: $title_color;

    &::after {
      background-color: $title_color_line;
    }
  }

  &.white {
    color: $title_color_white;

    &::after {
      background-color: $text_color_light;
    }
  }

  &::after {
    content: '';
    display: block;
    width: 100rem;
    position: absolute;
    height: 1px;
    bottom: 0;
    left: 0;
  }
}

.quotes {
  display: flex;
  flex-direction: column;
  padding-left: 40rem;
  position: relative;
}

.icon-left-quote {
  position: absolute;
  top: 3rem;
  left: 0;
  color: $title_color;
  font-size: 22rem;
}

.quotes_text {
  margin-top: 0;
  font-family: "SpaceGrotesk-Medium", sans-serif;
  font-size: 22rem;
  color: $text_color_dark;
  line-height: 165%;
}

.quotes_name {
  color: $title_color;
  font-family: "SpaceGrotesk-Regular", sans-serif;
  font-size: 14rem;
  margin-bottom: 5rem;
}

.quotes_job {
  color: $grey;
  font-family: "SpaceGrotesk-Regular", sans-serif;
  font-size: 14rem;
}

.aside {
  width: 330rem;
  margin-left: 132rem;
}

@media #{$mediaExtraLarge} and #{$media_1500} {
  .container {
    width: 1180px;
  }
}

@media #{$mediaLarge} {
  .container {
    width: 950px;
    padding: 0 20rem;
  }
}

@media #{$mediaMedium} {
  .container {
    width: 750px;
    padding: 0 20rem;
  }

  .section_title {
    font-size: 40rem;
    margin-left: 0;

    br {
      display: none;
    }
  }

  .bgc_text {
    display: none;
  }
}

@media #{$mediaSmall} {
  .container {
    width: 100%;
    padding: 0 20rem;
  }

  .section_title {
    font-size: 40rem;
    margin-left: 0;

    br {
      display: none;
    }
  }

  .bgc_text {
    display: none;
  }
}

@media #{$mediaExtraSmall} {
  .container {
    width: 100%;
    padding: 0 20rem;
  }

  .section_title {
    font-size: 40rem;
    margin-left: 0;

    br {
      display: none;
    }
  }

  .quotes .icon-left-quote {
    top: -20rem;
  }

  .bgc_text {
    display: none;
  }
}
